import React from 'react';
import {AreaHeader} from './styled';

function Header() {
    return(
    <div>
        <AreaHeader>
        <div className='container'>
            <div className='logo'>
                <p>LOGO</p>
            </div>
        </div>
        <h1>Topo do Site</h1>
        </AreaHeader>
    </div>
    )
};

export default Header;
